/// <reference types="Cypress"/>

describe('Add Book Form', () => {
    describe('form inputs', () => {
        it('should be able to fill out form', () => {
            cy.visit('http://localhost:1234/books/add');
            cy.get('#author').type('Paramahansa Yogananda');
            cy.get('#title').type('Autobiography of A Yogi');
            cy.get('#synopsis').type('A great story about a Yogi');
            cy.get('#published').type('2000-12-12');
            cy.get('#numPages').clear().type(512);
            cy.get('img').should('have.attr', 'src').should('include', '/blank.597d7858.jpg');
            cy.get('#file').attachFile('aoay.jpg');
            cy.get('img').should('have.attr', 'src').should('include', 'data:image/jpeg;base64,');
            cy.get('#star5').click({force: true});
        })
    })
})